import React, { Component } from 'react';
import Table from './Components/table';
import Button from './Components/Button';
import Ul from './Components/ul';
import Cities from './cities.json'
class App extends Component{
constructor(){
  super()
  this.state={
    datajson : Cities,
    Citieslength: Cities.length ,
    startshow : 0 ,
    notesonpaeg : 5
  }

}

render() {
const {datajson ,Citieslength ,startshow ,notesonpaeg } = this.state
const dd = datajson.slice(startshow,notesonpaeg)

  return(
    <div>
    <Button/>
    <Table datajson={dd}/>
    <Ul Citieslength={Citieslength}   notesonpaeg ={notesonpaeg} />
    </div>
  )
}
}
export default App;
